import unittest
import parsing.html.common as html_parser
import os.path

class Test_test_ftp_parsing(unittest.TestCase):
    def test_ftp_page_just_folders(self):
        html = '''<html><head><title>www.3gpp.org - /ftp/tsg_sa/</title></head><body><H1>www.3gpp.org - /ftp/tsg_sa/</H1><hr>
        <pre><A HREF="/ftp/">[To Parent Directory]</A><br><br>11/19/2018  8:36 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/TSG_SA/">TSG_SA</A><br>11/16/2018 11:00 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG1_Serv/">WG1_Serv</A><br> 12/7/2018  4:42 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG2_Arch/">WG2_Arch</A><br> 12/5/2018  1:07 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG3_Security/">WG3_Security</A><br>12/18/2018 11:20 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG4_CODEC/">WG4_CODEC</A><br>11/29/2018  8:19 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG5_TM/">WG5_TM</A><br> 9/27/2018  8:52 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG6_MissionCritical/">WG6_MissionCritical</A><br></pre><hr></body></html>'''
        parsed = html_parser.parse_3gpp_http_ftp(html)
        self.assertIsNotNone(parsed)
        self.assertEqual(parsed.location, '/ftp/tsg_sa/')
        self.assertListEqual(parsed.folders, [ 'TSG_SA', 'WG1_Serv', 'WG2_Arch', 'WG3_Security', 'WG4_CODEC', 'WG5_TM', 'WG6_MissionCritical' ])
        self.assertListEqual(parsed.files, [ ])

    def test_ftp_page_just_folders_and_dates(self):
        html = '''<html><head><title>www.3gpp.org - /ftp/tsg_sa/</title></head><body><H1>www.3gpp.org - /ftp/tsg_sa/</H1><hr>
        <pre><A HREF="/ftp/">[To Parent Directory]</A><br><br>11/19/2018  8:36 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/TSG_SA/">TSG_SA</A><br>11/16/2018 11:00 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG1_Serv/">WG1_Serv</A><br> 12/7/2018  4:42 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG2_Arch/">WG2_Arch</A><br> 12/5/2018  1:07 PM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG3_Security/">WG3_Security</A><br>12/18/2018 11:20 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG4_CODEC/">WG4_CODEC</A><br>11/29/2018  8:19 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG5_TM/">WG5_TM</A><br> 9/27/2018  8:52 AM        &lt;dir&gt; <A HREF="/ftp/tsg_sa/WG6_MissionCritical/">WG6_MissionCritical</A><br></pre><hr></body></html>'''
        parsed = html_parser.parse_3gpp_http_ftp(html)
        self.assertIsNotNone(parsed)
        self.assertEqual(parsed.location, '/ftp/tsg_sa/')
        folders = [ e[0] for e in parsed.folders_with_dates ]
        dates = [ e[1].strftime("%d/%m/%Y") for e in parsed.folders_with_dates ]
        self.assertListEqual(folders, [ 'TSG_SA', 'WG1_Serv', 'WG2_Arch', 'WG3_Security', 'WG4_CODEC', 'WG5_TM', 'WG6_MissionCritical' ])
        self.assertListEqual(dates, [ '19/11/2018', '16/11/2018', '07/12/2018', '05/12/2018', '18/12/2018', '29/11/2018', '27/09/2018' ])
        self.assertListEqual(parsed.files, [ ])

